Desde la Ciudad de Mendoza se toma por la RN Nº 40 hacia el sur, hasta el empalme con la RN Nº 7. Siguiendo esta última, se toma hacia el oeste hasta llegar a la localidad de Uspallata. Luego se sigue por RN Nº 7 hasta el Km 1203 (puesto de control de Gendarmería Nacional de Punta de Vacas). Desde allí se desvía de la ruta 500 m hacia la izquierda y se ncuentra el cerco meteorológico, a 100 m. de las instalaciones del Correo Argentino de Punta de Vacas. /// Para llegar a la estación de aforos se debe tomar una huella que se encuentra detras del galpón de Vialidad Nacional, y cruzando las vías del ferrocarril se recorren unos 700m. hasta llegar al puente que cruza el río Cuevas. Pasando ese puente se sube una cuesta de 200m. de largo y luego se toma una huella de aproximadamente 1.6 km. y se llega a la vagoneta;  600 m. más adelante se llega a la casilla de limnígrafo. 
/// 

Total Recorrido: a la estación meteorológica: 174.6 Km; a la estación de aforos: 177 Km.
